import React from 'react';

import Navigation from './Navigation';
import classes from './MainHeader.module.css';


const MainHeader = (props) => {
  return (
    <React.Fragment>
      <header className={classes['main-header']}>
        <h1>Gonki BG</h1>
        <Navigation />
      </header>

    </React.Fragment>
  );
};

export default MainHeader;
